import React from "react"

const Dashboard = () => {
    
    useEffect(() => 
    {
        const getProducts = async() => 
        {
            const response = await fetch('http://localhost:1337/')
            const json = await response.json()
        }
        getProducts()
    }, [])
    
    return (
        <div>
            <h2>Dashboard</h2>
            
        </div>
    )
}
export default Dashboard
